TdrError::ErrorType
BattleCreateParams::pack(TdrWriteBuf& destBuf, unsigned cutVer) const
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || BattleCreateParams::CURRVERSION < cutVer)
    {
        cutVer = BattleCreateParams::CURRVERSION;
    }

    /* check cutversion */
    if (BattleCreateParams::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* pack member: this->GameVersion */
    {
        /* record sizeinfo position */
        const size_t sizePos4GameVersion = destBuf.getUsedSize();

        /* reserve space for sizeinfo */
        ret = destBuf.reserve(sizeof(uint32_t));
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* record real-data's begin postion in buf */
        const size_t beginPos4GameVersion = destBuf.getUsedSize();

        /* gurantee string or wstring terminated with null character */
        *(char*)&this->GameVersion[sizeof(this->GameVersion)-1] = '\0';

        size_t realSize4GameVersion = strlen(this->GameVersion) + 1;

        /* pack */
        ret = destBuf.writeBytes(this->GameVersion, realSize4GameVersion);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* set sizeinfo for this->GameVersion */
        const size_t size4GameVersion = destBuf.getUsedSize() - beginPos4GameVersion;
        ret = destBuf.writeUInt32((uint32_t)(size4GameVersion), sizePos4GameVersion);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->battleID */
    {
        ret = destBuf.writeUInt64(this->battleID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->randSeed */
    {
        ret = destBuf.writeInt32(this->randSeed);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->framePerSecond */
    {
        ret = destBuf.writeInt32(this->framePerSecond);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->sceneParams */
    {
        ret = this->sceneParams.pack(destBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->teamStateParams */
    {
        for (unsigned teamStateParams_i = 0; teamStateParams_i < MAX_BATTLTEAM_MAX_COUNT; teamStateParams_i++)
        {
            ret = this->teamStateParams[teamStateParams_i].pack(destBuf, cutVer);
            if (TdrError::TDR_NO_ERROR != ret)
            {
                TSF4G_TDR_DEBUG_TRACE();
                return ret;
            }
        }
    }

    return ret;
}

