TdrError::ErrorType
BattleReplaysHeader::unpack(TdrReadBuf& srcBuf, unsigned cutVer)
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || BattleReplaysHeader::CURRVERSION < cutVer)
    {
        cutVer = BattleReplaysHeader::CURRVERSION;
    }

    /* check cutversion */
    if (BattleReplaysHeader::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* unpack member: this->magic */
    {
        ret = srcBuf.readInt32(this->magic);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->version */
    {
        ret = srcBuf.readInt32(this->version);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->gameVersion */
    {
        /* get sizeinfo for this->gameVersion */
        uint32_t size4gameVersion;
        ret = srcBuf.readUInt32(size4gameVersion);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether data in buffer are enough */
        if (size4gameVersion > srcBuf.getLeftSize())
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_SHORT_BUF_FOR_READ;
        }

        /* check whether sizeinfo is valid */
        if (size4gameVersion > sizeof(this->gameVersion))
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_BIG;
        }

        /* string or wstring must contains a null character */
        if (1 > size4gameVersion)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_SMALL;
        }

        /* unpack */
        ret = srcBuf.readBytes(this->gameVersion, size4gameVersion);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether string-content is consistent with sizeinfo */
        if ('\0' != this->gameVersion[size4gameVersion - 1])
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
        size_t realSize4gameVersion = strlen(this->gameVersion) + 1;
        if (size4gameVersion != realSize4gameVersion)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
    }

    /* unpack member: this->battleVsMode */
    {
        ret = srcBuf.readInt8(this->battleVsMode);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->battleID */
    {
        ret = srcBuf.readUInt64(this->battleID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->sceneID */
    {
        ret = srcBuf.readInt32(this->sceneID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->createTime */
    {
        ret = srcBuf.readInt64(this->createTime);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->frameCnt */
    {
        ret = srcBuf.readInt32(this->frameCnt);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->battleResult */
    {
        ret = srcBuf.readInt8(this->battleResult);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->battleCreateParams */
    {
        ret = this->battleCreateParams.unpack(srcBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->teamExtraInfos */
    {
        for (unsigned teamExtraInfos_i = 0; teamExtraInfos_i < MAX_BATTLTEAM_MAX_COUNT; teamExtraInfos_i++)
        {
            ret = this->teamExtraInfos[teamExtraInfos_i].unpack(srcBuf, cutVer);
            if (TdrError::TDR_NO_ERROR != ret)
            {
                TSF4G_TDR_DEBUG_TRACE();
                return ret;
            }
        }
    }

    return ret;
}

