TdrError::ErrorType
CSStatisticsGold::pack(TdrWriteBuf& destBuf, unsigned cutVer) const
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || CSStatisticsGold::CURRVERSION < cutVer)
    {
        cutVer = CSStatisticsGold::CURRVERSION;
    }

    /* check cutversion */
    if (CSStatisticsGold::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* pack member: this->TotalGold */
    {
        ret = destBuf.writeInt32(this->TotalGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->SystemGold */
    {
        ret = destBuf.writeInt32(this->SystemGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->GoldMineGold */
    {
        ret = destBuf.writeInt32(this->GoldMineGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->KillMonsterGold */
    {
        ret = destBuf.writeInt16(this->KillMonsterGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->KillActorGold */
    {
        ret = destBuf.writeInt16(this->KillActorGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->RepariGold */
    {
        ret = destBuf.writeInt16(this->RepariGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->BuildDogfaceGold */
    {
        ret = destBuf.writeInt16(this->BuildDogfaceGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->TechUpGold */
    {
        ret = destBuf.writeInt16(this->TechUpGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->BuildOtherGold */
    {
        ret = destBuf.writeInt16(this->BuildOtherGold);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->GoldTimeline */
    {
        for (unsigned GoldTimeline_i = 0; GoldTimeline_i < MAX_BATTLSTATISSTIC_GOLDGET_MAX_COUNT; GoldTimeline_i++)
        {
            ret = destBuf.writeInt32(this->GoldTimeline[GoldTimeline_i]);
            if (TdrError::TDR_NO_ERROR != ret)
            {
                TSF4G_TDR_DEBUG_TRACE();
                return ret;
            }
        }
    }

    return ret;
}

