TdrError::ErrorType
CSStatisticsTeam::pack(TdrWriteBuf& destBuf, unsigned cutVer) const
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || CSStatisticsTeam::CURRVERSION < cutVer)
    {
        cutVer = CSStatisticsTeam::CURRVERSION;
    }

    /* check cutversion */
    if (CSStatisticsTeam::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* pack member: this->Active */
    {
        ret = destBuf.writeInt8(this->Active);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->PlayID */
    {
        ret = destBuf.writeInt32(this->PlayID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->PlayName */
    {
        /* record sizeinfo position */
        const size_t sizePos4PlayName = destBuf.getUsedSize();

        /* reserve space for sizeinfo */
        ret = destBuf.reserve(sizeof(uint32_t));
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* record real-data's begin postion in buf */
        const size_t beginPos4PlayName = destBuf.getUsedSize();

        /* gurantee string or wstring terminated with null character */
        *(char*)&this->PlayName[sizeof(this->PlayName)-1] = '\0';

        size_t realSize4PlayName = strlen(this->PlayName) + 1;

        /* pack */
        ret = destBuf.writeBytes(this->PlayName, realSize4PlayName);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* set sizeinfo for this->PlayName */
        const size_t size4PlayName = destBuf.getUsedSize() - beginPos4PlayName;
        ret = destBuf.writeUInt32((uint32_t)(size4PlayName), sizePos4PlayName);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->TeamType */
    {
        ret = destBuf.writeInt8(this->TeamType);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->RaceType */
    {
        ret = destBuf.writeInt8(this->RaceType);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->LegionType */
    {
        ret = destBuf.writeInt8(this->LegionType);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->HeroLv */
    {
        ret = destBuf.writeInt8(this->HeroLv);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->ActorResIDCnt */
    {
        ret = destBuf.writeInt8(this->ActorResIDCnt);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->BattleScore */
    {
        ret = destBuf.writeInt32(this->BattleScore);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->IsMvp */
    {
        ret = destBuf.writeInt8(this->IsMvp);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->RankLevel */
    {
        ret = destBuf.writeInt8(this->RankLevel);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->ActorStatistic */
    {
        if (0 > this->ActorResIDCnt)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_MINUS_REFER_VALUE;
        }
        if (MAX_BATTLSTATISSTICD_TECHDOGFACE_MAX_COUNT < this->ActorResIDCnt)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_REFER_SURPASS_COUNT;
        }
        for (int8_t ActorStatistic_i = 0; ActorStatistic_i < this->ActorResIDCnt; ActorStatistic_i++)
        {
            ret = this->ActorStatistic[ActorStatistic_i].pack(destBuf, cutVer);
            if (TdrError::TDR_NO_ERROR != ret)
            {
                TSF4G_TDR_DEBUG_TRACE();
                return ret;
            }
        }
    }

    /* pack member: this->TechStatistic */
    {
        ret = this->TechStatistic.pack(destBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->DmgStatistics */
    {
        ret = this->DmgStatistics.pack(destBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->GoldStatistics */
    {
        ret = this->GoldStatistics.pack(destBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->EquipStatistics */
    {
        ret = this->EquipStatistics.pack(destBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    return ret;
}

