        /* check whether data in buffer are enough */
        if (size4PlayName > srcBuf.getLeftSize())
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_SHORT_BUF_FOR_READ;
        }

        /* check whether sizeinfo is valid */
