TdrError::ErrorType
CSBattleLoginReq::pack(TdrWriteBuf& destBuf, unsigned cutVer) const
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || CSBattleLoginReq::CURRVERSION < cutVer)
    {
        cutVer = CSBattleLoginReq::CURRVERSION;
    }

    /* check cutversion */
    if (CSBattleLoginReq::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* pack member: this->AccessToken */
    {
        /* record sizeinfo position */
        const size_t sizePos4AccessToken = destBuf.getUsedSize();

        /* reserve space for sizeinfo */
        ret = destBuf.reserve(sizeof(uint32_t));
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* record real-data's begin postion in buf */
        const size_t beginPos4AccessToken = destBuf.getUsedSize();

        /* gurantee string or wstring terminated with null character */
        *(char*)&this->AccessToken[sizeof(this->AccessToken)-1] = '\0';

        size_t realSize4AccessToken = strlen(this->AccessToken) + 1;

        /* pack */
        ret = destBuf.writeBytes(this->AccessToken, realSize4AccessToken);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* set sizeinfo for this->AccessToken */
        const size_t size4AccessToken = destBuf.getUsedSize() - beginPos4AccessToken;
        ret = destBuf.writeUInt32((uint32_t)(size4AccessToken), sizePos4AccessToken);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->PlayerID */
    {
        ret = destBuf.writeInt32(this->PlayerID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->RoomID */
    {
        ret = destBuf.writeInt32(this->RoomID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->LoginType */
    {
        ret = destBuf.writeInt8(this->LoginType);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->ProtocolMd5 */
    {
        /* record sizeinfo position */
        const size_t sizePos4ProtocolMd5 = destBuf.getUsedSize();

        /* reserve space for sizeinfo */
        ret = destBuf.reserve(sizeof(uint32_t));
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* record real-data's begin postion in buf */
        const size_t beginPos4ProtocolMd5 = destBuf.getUsedSize();

        /* gurantee string or wstring terminated with null character */
        *(char*)&this->ProtocolMd5[sizeof(this->ProtocolMd5)-1] = '\0';

        size_t realSize4ProtocolMd5 = strlen(this->ProtocolMd5) + 1;

        /* pack */
        ret = destBuf.writeBytes(this->ProtocolMd5, realSize4ProtocolMd5);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* set sizeinfo for this->ProtocolMd5 */
        const size_t size4ProtocolMd5 = destBuf.getUsedSize() - beginPos4ProtocolMd5;
        ret = destBuf.writeUInt32((uint32_t)(size4ProtocolMd5), sizePos4ProtocolMd5);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    return ret;
}

