TdrError::ErrorType
CSBattleLoginReq::unpack(TdrReadBuf& srcBuf, unsigned cutVer)
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || CSBattleLoginReq::CURRVERSION < cutVer)
    {
        cutVer = CSBattleLoginReq::CURRVERSION;
    }

    /* check cutversion */
    if (CSBattleLoginReq::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* unpack member: this->AccessToken */
    {
        /* get sizeinfo for this->AccessToken */
        uint32_t size4AccessToken;
        ret = srcBuf.readUInt32(size4AccessToken);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether data in buffer are enough */
        if (size4AccessToken > srcBuf.getLeftSize())
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_SHORT_BUF_FOR_READ;
        }

        /* check whether sizeinfo is valid */
        if (size4AccessToken > sizeof(this->AccessToken))
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_BIG;
        }

        /* string or wstring must contains a null character */
        if (1 > size4AccessToken)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_SMALL;
        }

        /* unpack */
        ret = srcBuf.readBytes(this->AccessToken, size4AccessToken);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether string-content is consistent with sizeinfo */
        if ('\0' != this->AccessToken[size4AccessToken - 1])
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
        size_t realSize4AccessToken = strlen(this->AccessToken) + 1;
        if (size4AccessToken != realSize4AccessToken)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
    }

    /* unpack member: this->PlayerID */
    {
        ret = srcBuf.readInt32(this->PlayerID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->RoomID */
    {
        ret = srcBuf.readInt32(this->RoomID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->LoginType */
    {
        ret = srcBuf.readInt8(this->LoginType);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->ProtocolMd5 */
    {
        /* get sizeinfo for this->ProtocolMd5 */
        uint32_t size4ProtocolMd5;
        ret = srcBuf.readUInt32(size4ProtocolMd5);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether data in buffer are enough */
        if (size4ProtocolMd5 > srcBuf.getLeftSize())
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_SHORT_BUF_FOR_READ;
        }

        /* check whether sizeinfo is valid */
        if (size4ProtocolMd5 > sizeof(this->ProtocolMd5))
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_BIG;
        }

        /* string or wstring must contains a null character */
        if (1 > size4ProtocolMd5)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_SMALL;
        }

        /* unpack */
        ret = srcBuf.readBytes(this->ProtocolMd5, size4ProtocolMd5);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether string-content is consistent with sizeinfo */
        if ('\0' != this->ProtocolMd5[size4ProtocolMd5 - 1])
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
        size_t realSize4ProtocolMd5 = strlen(this->ProtocolMd5) + 1;
        if (size4ProtocolMd5 != realSize4ProtocolMd5)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
    }

    return ret;
}

