TdrError::ErrorType
CSBattleLoginRsp::visualize(TdrWriteBuf& destBuf, int indent, char separator) const
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* visualize member: this->RetCode */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[RetCode]", "%d", this->RetCode);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize member: this->PlayerID */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[PlayerID]", "%d", this->PlayerID);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize member: this->LoginType */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[LoginType]", "0x%02x", this->LoginType);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize member: this->CreateParams */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[CreateParams]", true);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize children of this->CreateParams */
    if (0 > indent)
    {
        ret = this->CreateParams.visualize(destBuf, indent, separator);
    } else
    {
        ret = this->CreateParams.visualize(destBuf, indent + 1, separator);
    }
    if (TdrError::TDR_NO_ERROR != ret)
    {
        return ret;
    }

    /* visualize member: this->FrameSync */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[FrameSync]", "%d", this->FrameSync);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    return ret;
}

