TdrError::ErrorType
CSGameEndReq::unpack(TdrReadBuf& srcBuf, unsigned cutVer)
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || CSGameEndReq::CURRVERSION < cutVer)
    {
        cutVer = CSGameEndReq::CURRVERSION;
    }

    /* check cutversion */
    if (CSGameEndReq::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* unpack member: this->frame */
    {
        ret = srcBuf.readInt32(this->frame);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->statisticsBattle */
    {
        ret = this->statisticsBattle.unpack(srcBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->dumpLength */
    {
        ret = srcBuf.readInt32(this->dumpLength);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* unpack member: this->dumpInfo */
    {
        /* get sizeinfo for this->dumpInfo */
        uint32_t size4dumpInfo;
        ret = srcBuf.readUInt32(size4dumpInfo);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether data in buffer are enough */
        if (size4dumpInfo > srcBuf.getLeftSize())
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_SHORT_BUF_FOR_READ;
        }

        /* check whether sizeinfo is valid */
        if (size4dumpInfo > sizeof(this->dumpInfo))
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_BIG;
        }

        /* string or wstring must contains a null character */
        if (1 > size4dumpInfo)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_TOO_SMALL;
        }

        /* unpack */
        ret = srcBuf.readBytes(this->dumpInfo, size4dumpInfo);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* check whether string-content is consistent with sizeinfo */
        if ('\0' != this->dumpInfo[size4dumpInfo - 1])
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
        size_t realSize4dumpInfo = strlen(this->dumpInfo) + 1;
        if (size4dumpInfo != realSize4dumpInfo)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return TdrError::TDR_ERR_STR_LEN_CONFLICT;
        }
    }

    return ret;
}

