TdrError::ErrorType
CSFrameBattleStartMove::visualize(TdrWriteBuf& destBuf, int indent, char separator) const
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* visualize member: this->TargetPos */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[TargetPos]", true);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize children of this->TargetPos */
    if (0 > indent)
    {
        ret = this->TargetPos.visualize(destBuf, indent, separator);
    } else
    {
        ret = this->TargetPos.visualize(destBuf, indent + 1, separator);
    }
    if (TdrError::TDR_NO_ERROR != ret)
    {
        return ret;
    }

    /* visualize member: this->CurPos */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[CurPos]", true);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize children of this->CurPos */
    if (0 > indent)
    {
        ret = this->CurPos.visualize(destBuf, indent, separator);
    } else
    {
        ret = this->CurPos.visualize(destBuf, indent + 1, separator);
    }
    if (TdrError::TDR_NO_ERROR != ret)
    {
        return ret;
    }

    /* visualize member: this->CurDir */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[CurDir]", true);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize children of this->CurDir */
    if (0 > indent)
    {
        ret = this->CurDir.visualize(destBuf, indent, separator);
    } else
    {
        ret = this->CurDir.visualize(destBuf, indent + 1, separator);
    }
    if (TdrError::TDR_NO_ERROR != ret)
    {
        return ret;
    }

    /* visualize member: this->MoveDir_X */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[MoveDir_X]", "%d", this->MoveDir_X);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize member: this->MoveDir_Z */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[MoveDir_Z]", "%d", this->MoveDir_Z);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize member: this->OpMode */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[OpMode]", "0x%02x", this->OpMode);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    /* visualize member: this->WalkFlag */
    ret = TdrBufUtil::printVariable(destBuf, indent, separator, "[WalkFlag]", "0x%02x", this->WalkFlag);
    if (TdrError::TDR_NO_ERROR != ret)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return ret;
    }

    return ret;
}

const char*
CSFrameBattleStartMove::visualize_ex(char* buffer, size_t size, size_t* usedSize, int indent, char separator) const
{
    if (NULL == buffer || 0 == size)
    {
        return "";
    }

    TdrWriteBuf destBuf(buffer, size);
    visualize(destBuf, indent, separator);

    size_t targetPos = destBuf.getUsedSize();
    const size_t totalSize = size;
    if (totalSize <= targetPos)
    {
        targetPos = totalSize - 1;
    }
    buffer[targetPos] = '\0';

    if (NULL != usedSize)
    {
        *usedSize = destBuf.getUsedSize();
    }

    return destBuf.getBeginPtr();
}

const char*
CSFrameBattleStartMove::visualize_ex(TdrWriteBuf& destBuf, int indent, char separator) const
{
    if (NULL == destBuf.getBeginPtr() || 0 == destBuf.getTotalSize())
    {
        return "";
    }

    visualize(destBuf, indent, separator);

    size_t targetPos = destBuf.getUsedSize();
    const size_t totalSize = destBuf.getTotalSize();
    if (totalSize <= targetPos)
    {
        targetPos = totalSize - 1;
    }
    destBuf.writeChar('\0', targetPos);

    return destBuf.getBeginPtr();
}


