        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* set sizeinfo for this->key1 */
        const size_t size4key1 = destBuf.getUsedSize() - beginPos4key1;
