TdrError::ErrorType
CSReplaySvrGameEndReq::pack(TdrWriteBuf& destBuf, unsigned cutVer) const
{
    TdrError::ErrorType ret = TdrError::TDR_NO_ERROR;

    /* adjust cutversion */
    if (0 == cutVer || CSReplaySvrGameEndReq::CURRVERSION < cutVer)
    {
        cutVer = CSReplaySvrGameEndReq::CURRVERSION;
    }

    /* check cutversion */
    if (CSReplaySvrGameEndReq::BASEVERSION > cutVer)
    {
        TSF4G_TDR_DEBUG_TRACE();
        return TdrError::TDR_ERR_CUTVER_TOO_SMALL;
    }

    /* pack member: this->frame */
    {
        ret = destBuf.writeInt32(this->frame);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->BsRoomID */
    {
        ret = destBuf.writeInt32(this->BsRoomID);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->statisticsBattle */
    {
        ret = this->statisticsBattle.pack(destBuf, cutVer);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->dumpLength */
    {
        ret = destBuf.writeInt32(this->dumpLength);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    /* pack member: this->dumpInfo */
    {
        /* record sizeinfo position */
        const size_t sizePos4dumpInfo = destBuf.getUsedSize();

        /* reserve space for sizeinfo */
        ret = destBuf.reserve(sizeof(uint32_t));
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* record real-data's begin postion in buf */
        const size_t beginPos4dumpInfo = destBuf.getUsedSize();

        /* gurantee string or wstring terminated with null character */
        *(char*)&this->dumpInfo[sizeof(this->dumpInfo)-1] = '\0';

        size_t realSize4dumpInfo = strlen(this->dumpInfo) + 1;

        /* pack */
        ret = destBuf.writeBytes(this->dumpInfo, realSize4dumpInfo);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }

        /* set sizeinfo for this->dumpInfo */
        const size_t size4dumpInfo = destBuf.getUsedSize() - beginPos4dumpInfo;
        ret = destBuf.writeUInt32((uint32_t)(size4dumpInfo), sizePos4dumpInfo);
        if (TdrError::TDR_NO_ERROR != ret)
        {
            TSF4G_TDR_DEBUG_TRACE();
            return ret;
        }
    }

    return ret;
}

